function App() {
  const mystyle = {
    color: "black",
    textAlign:"center",
    padding: "10px",
    fontFamily: "Arial"
  };
   const textareastyle ={
    height:" 50px",
    width: "50px"
   }

  return (
    <div className="container">
      <h1 style={{ color: 'red', textAlign: 'center' }}>  Susmita</h1>
      <div className="mb-3" style={{textAlign: "center"}}>
        <textarea  style={textareastyle} className="form-control" id="mybox" rows="3"></textarea>


      </div>
      <br/>
      <div  style={{textAlign: "center"}}>
        <input style={mystyle} type="text" className="form-control" id="ex" placeholder="Enter" />
      </div>

    </div>

  );
}

export default App;
